import React, { Component } from 'react';
import '../css/Header.css'

export default class Header extends Component {
  render() {
    return (
      <header className='Header'>
        <div className='Header__logo_name'>
          <span className='Header__logo_ellipse1'></span>
        </div>
      </header>
    )

  }
}
